Well what can I say? We closed out 2022 in grand funky Further fashion! 🙌🏾
It is so humbling to have so many heavy-hitters and excellent, talented DJs come play for the last @djbonegoesfurther of 2022. It was such a vibe, such a ritualistic gathering indeed. I want to thank everyone who came to our over-sold out event and danced and stayed the entire night. It was still packed at 7am!!
And of course so much love and respect to my friends who came along for the Further ride. You all blazed it! Not a bad song played, not a bad mix mixed. Absolute top notch music in every room. It was like a pick your adventure video game. 👊🏾
I have so much love for you all but I know you know this. You know how much this night means to us and all of your sets came from deep inside your souls. I appreciate this more than you know. 🫶🏾
THIS is the mission. 
THIS is what it’s all about. 
THIS is how we take things FURTHER. 
Wait til you see what we have coming in 2023 😉

And a special thank you to Mrs 🦴 @i.am.ahnne for putting this all together and our Further crew for all the hard work and our home club @radionamsterdam for letting us take it too far, some might even say further. 😉🙏🏾
