FURTHER is 3 👊🏾 To celebrate, we will host an unforgettable night at the place where it all began - RADION - with a few special friends. We will welcome the techno and house aliases of the iconic Ben Sims, the electro industrial queen herself, Helena Hauff, and tech house legend, Will Clarke.

FURTHER was born in June 2020. Starting as a sofa sit down gathering, Professor Bone took us on a weekly journey through 19+ lessons - covering genres, artists, movements, and sounds from across the globe. People needed a release, a music therapy. But it had to be special, we needed to take things FURTHER. Now, 3 years later, we are growing, building and transforming more than ever before.

We have a lot of excitement behind what we will soon reveal to you all from the world of FURTHER, so let’s start with a 3 year anniversary bash, to dance into this new era together. A night where you will truly experience a real vibe, from beginning to end.

THIS IS FURTHER
